import React, { useState, useEffect } from "react";
import useTable from "../utils/useTable";
import { useApolloClient } from "@apollo/react-hooks";
import {
  Paper,
  Typography,
  TableBody,
  TableRow,
  TableCell,
  Grid,
  Toolbar,
  InputAdornment,
} from "@material-ui/core";
import Popup from "../utils/Popup";
import Button from "@material-ui/core/Button";
import Search from "@material-ui/icons/Search";
import { ErrorMessage, Formik, Form, Field } from "formik";
import { TextField } from "material-ui-formik-components/TextField";

import { getAllRanksQuery } from "../queries&Mutations&Functions/Queries";

const headCells = [
  { id: "rankName", label: "Libelle Poste" },
  { id: "rankCode", label: "Code Poste" },
  { id: "id", label: "ID" },
];

const NewRankList = () => {
  const client = useApolloClient();
  const [ranks, setRanks] = useState([]);
  const [filterFn, setFilterFn] = useState({
    fn: (items) => {
      return items;
    },
  });

  const {
    TblContainer,
    TblHead,
    TblPagination,
    recordsAfterPagingAndSorting,
  } = useTable(ranks, headCells, filterFn);

  const loadRanksData = async () => {
    const { error, data } = await client.query({
      query: getAllRanksQuery,
    });
    const { ranks } = { ...data };
    console.log(ranks);

    setRanks(ranks);
  };

  useEffect(() => {
    loadRanksData();
    console.log(ranks);
  }, []);

   const handleSearch = (e) => {
     const target = e.target;
     setFilterFn({
       fn: (items) => {
         if (target.value == "") {
           return items;
         } else {
           items.filterFn((x) =>
             x.rankName.toLowerCase().includes(target.value)
           );
         }
       },
     });
   };

  return (
    <Formik>
      {({ isSubmitting }) => {
        return (
          <Paper>
            <TblContainer>
              <Toolbar>
                <Grid container>
                  <Grid item xs={8}>
                    <Field
                      component={TextField}
                      autocomplete="off"
                      name="search"
                      type="search"
                      label="Search"
                      fullWidth
                      onChange={handleSearch}
                      variant="outlined"
                      inputProps={{
                        startAdornment: (
                          <InputAdornment position="start">
                            <Search />
                          </InputAdornment>
                        ),
                      }}
                    />
                  </Grid>
                  <Grid item xs={4}>
                    <Button onClick={submitForm}>AddNew</Button>
                  </Grid>
                </Grid>
              </Toolbar>
              <TblHead />
              <TableBody>
                {recordsAfterPagingAndSorting().map((item) => (
                  <TableRow key={item.id}>
                    <TableCell>{item.rankName}</TableCell>
                    <TableCell>{item.rankCode}</TableCell>
                    <TableCell>{item.id}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </TblContainer>
            <TblPagination />
          </Paper>
        );
      }}
    </Formik>
  );
};
export default NewRankList;
